import styled from 'styled-components';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        Jordan Moore
      </header>
    </div>
  );
}

export default App;

const StyledApp = styled.div`
  background-color: var(--dark2);
`;
